INSERT INTO `ushop_article` (`id`, `store_id`, `article_cat_id`, `title`, `content`, `sort`, `addtime`, `is_delete`)
VALUES
	(1,1,1,'丹阳国际眼镜城','<p><span style=\"display: inline !important; float: none; background-color: transparent; color: rgb(0, 0, 0); font-family: 宋体; font-size: 14px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; line-height: 28px; list-style-type: none; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp;丹阳素有“眼镜之都”美誉。丹阳市市场监督管理局交出一份全产业标准化服务的答卷，有力地促进了眼镜产业健康持续发展。近年来，该局采取多项举措，全方位为眼镜产业的发展提供标准化服务，发挥标准的引领作用，助推丹阳眼镜质量提升。</span></p>',1,1522307994,0),
	(2,1,1,'中国（丹阳）国际眼镜城','<p><span style=\"color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; text-indent: 28px; background-color: rgb(255, 255, 255);\">中国（丹阳）国际眼镜城，与</span><a target=\"_blank\" href=\"https://baike.baidu.com/item/%E4%B8%AD%E5%9B%BD%EF%BC%88%E4%B8%B9%E9%98%B3%EF%BC%89%E7%9C%BC%E9%95%9C%E5%9F%8E\" style=\"color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, 宋体, sans-serif; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">中国（丹阳）眼镜城</a><span style=\"color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; text-indent: 28px; background-color: rgb(255, 255, 255);\">相邻，项目位于京杭运河与沪宁城际铁路之间，中山路与站前路交叉口，紧临丹阳火车站与汽车站，该项目总面积为45314平方米，总建筑面积110919平方米，项目总投资约5亿人民币。中国眼镜城大厦总体规划布局由交易区、配套商务酒店组成，交易区面积约6万平方米，以眼镜销售批发为主，南侧的商务酒店面积约2万平方米。既能满足眼镜城的商务办公、旅游接待等配套功能，又是该区域的标志性建筑，展现出了城市的名片形象。丹阳眼镜城项目完全摆脱了传统眼镜市场的单一商业模式，是集休闲娱乐、餐饮住宿、商务办公、影视表演等为一体的体验式商业。该模式表现的是一种城市生活休闲中心，在建筑层面上体现为商业街区模式，这个街区开放通透，内部水街亲切宜人。具有良好的环境和商业氛围。眼镜城的未来不仅仅是单位的商业建筑，也是丹阳市民未来的活动体验中心。</span></p>',1,1522308112,0);
