INSERT INTO `ushop_topic` (`id`, `store_id`, `title`, `sub_title`, `cover_pic`, `content`, `read_count`, `virtual_read_count`, `layout`, `sort`, `agree_count`, `virtual_agree_count`, `virtual_favorite_count`, `addtime`, `is_delete`)
VALUES
	(1,1,'刹车失灵怎么办？牢记这6招关键时刻能保命','','https://p3.pstatp.com/large/pgc-image/1518158557275f2954c7788','<p><br/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">刹车系统是一辆汽车至关重要的系统，决定着人们开车的安全性。刹车一旦损害，出现刹车失灵等状况，车主发生车祸的几率会直线上升，很多大型事故都是由于刹车失灵导致的。那么，如果刹车失灵了，各位车主应该怎么做呢？下面编辑给大家推荐几招，学会了可以保命哦~当然也希望大家永远不会遇到刹车失灵的情况！</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"https://p3.pstatp.com/large/pgc-image/1518158557275f2954c7788\" alt=\"刹车失灵怎么办？牢记这6招关键时刻能保命\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第一步，调整心态，沉着应对。</span><br/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">当发现刹车系统失灵时，千万不能慌乱，因为一旦慌乱就容易出错，再把刹车当油门踩，只会雪上加霜让情况变得更糟糕。所以一定要沉着冷静，调整好心态，既然已经发生了，就要想办法自救，把损失降到最小。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第二步，打开应急灯，提醒周围车辆。</span></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">在刹车失灵的紧急状况下，很多司机都只想着如何让车辆减速，而忽视了对周围车辆的提醒。这样做并不能说不对，但如果在采取减速措施的同时，通过打开双闪和鸣笛来引起周围行驶车辆的注意，会让自救的成功率变得更高。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第三步，多踩几次刹车踏板，增加制动力恢复的机会。</span></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">当发现刹车踏板失效时，要下意识地多次松开再踩下刹车踏板，这样会对油管内有空气的制动系统施加压力，通过多次的施压，可以增加制动力恢复的机会（一般第二或第三脚可以恢复刹车力）。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"https://p3.pstatp.com/large/pgc-image/1518158557283048fc35be9\" alt=\"刹车失灵怎么办？牢记这6招关键时刻能保命\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第四步，拉手刹减速。</span></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">当制动力依旧不能恢复时，就需要通过拉手刹来减慢车速。拉手刹时必须切记两点：</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">1、手刹不能一下拉到底或者拉的过快。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">因为车速、惯性等原因，一旦把手刹拉的过快、过死，就会造成钢丝绳蹦断，手刹也就彻底失效了。所以应当缓缓用力，慢慢将手刹拉到底。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">2、拉手刹时，尽量不要猛打方向，否则后轮本身已经被抱死，很容易发生侧滑甚至翻车现象。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">对于采用电子驻车（电子手刹）的一些中高级车型来说，一旦刹车失灵，通过拉起手刹按键将车辆减速的成功率会更高。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">因为目前诸如大众、雪佛兰、别克等一些主流品牌车辆的电子手刹除了具备本身的驻车功能外，还具备紧急刹车功能。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">在车速超过7km/h时，拉起电子手刹按键，此时车子会通过ESP控制单元以近乎全力的刹车力道对四个车轮进行液压制动，以保证车辆能在刹车系统失效的情况下紧急刹停。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"https://p3.pstatp.com/large/pgc-image/1518158557379e89e269c03\" alt=\"刹车失灵怎么办？牢记这6招关键时刻能保命\"/></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第五步，强制降档减速。</span></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">对于手动挡车型来说，如果拉手刹减速缓慢或者手刹失效，就要通过强制降档，以发动机制动来拖慢车速。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">如果车速较快，变速箱此时已经很难开合，大多抢不进低档位，所以正确的操作是给一大脚油门，轰开同步器，强行推进低档位，再轰一脚油门，进档。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">不过强制降档减速很容易使发动机转速飙升到超过转速极限值，会对发动机本身造成不小的伤害。但本着生命价值高于一切的原则，即使会让发动机受损，在紧急时刻也一定要果断操作。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; font-weight: 700;\">第六步，摩擦障碍物减慢车速。</span></p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">当发现车辆前方有致命阻挡物无法避让时，我们需要以最短的时间让车辆尽快停下来。这时，再通过降档减速的方法可能就来不及了，我们可以直接通过摩擦道路两旁的山体、栏杆、树木或建筑等障碍物让车辆尽快停下来。</p><p style=\"-webkit-tap-highlight-color: transparent; box-sizing: border-box; margin-top: 16px; margin-bottom: 16px; padding: 0px; color: rgb(34, 34, 34); font-family: &#39;PingFang SC&#39;, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, &#39;WenQuanYi Micro Hei&#39;, &#39;Helvetica Neue&#39;, Arial, sans-serif; font-size: 16px; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">要靠一点，打回来一点，再向障碍物靠一把，再打回来一把。</p>',13,16,0,1000,0,0,2,1520521156,1),
	(3,1,'消费者如何选择适合自己的镜片？','','https://app.taobaomaichang.com/uploads/image/aa/aa4399b259e37b2dfea7a3fad6324112.jpg','<p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; 随着各类电子产品在我们日常生活中的不断渗透，为眼睛安装一扇保护窗，成为了大多数人的明智之选。那么在充斥着各种镜片材料的眼镜店里，面对推销人员的热情介绍，我们该如何选择性价比较高的眼镜片产品呢？<br/></p><p><img src=\"https://app.taobaomaichang.com/uploads/image/aa/aa4399b259e37b2dfea7a3fad6324112.jpg\" title=\"\" alt=\"\"/></p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; 镜片根据材料的不同可分为四种：玻璃镜片、树脂镜片、太空镜片、特殊镜片。</p><p><br/></p><p style=\"line-height: 1.75em;\">玻璃镜片</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; &nbsp;不容易划花，折射率高。玻璃片易碎，材质偏重。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; &nbsp;玻璃镜片，具有比其它材质的镜片更耐刮的特性，但相对的其重量也较沉，其折射率相对高:普通片为1.523，超薄片为:1.72以上，最高可达2.0。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; 玻璃镜片的主要原料是光学玻璃。其折射率比树脂镜片高，因此在同样度数情况下，玻璃镜片要比树脂镜片薄。玻璃镜片的透光率和机械化学性能都比较好，有恒定的折射率、理化性能稳定。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; &nbsp;玻璃片光学性质优越，折射率愈高，则镜片愈薄。透光性好，光学树脂镜片抗冲击力强。折射率适中。</p><p><br/></p><p style=\"line-height: 1.75em;\">树脂镜片</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; 树脂镜片就是用树脂为原材料化学加工合成打磨后的镜片。树脂镜片材质轻。抗冲击力强。是玻璃的好几倍，故而不易破碎，安全耐用。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; 树脂镜片透光性好。在可见光区，树脂镜片透光率与玻璃相似;红外光区，比玻璃稍高;紫外区，以0.4um开始随着波长的减小透光率降低，波长小于0.3um的光几乎全部吸收。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; &nbsp;其制作成本低。售价也能被大众所消费得起。注射成型的镜片，只需制造一个精密的模子后，就可大量生产，节省了加工费用和时间。也可以制作非球面镜片。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; &nbsp;但树脂镜片的制作也存在一定缺陷，其表面耐磨力、抗化学能力比玻璃差，表面易划痕，吸水性比玻璃大，这些缺点可通过镀膜方法改善。致命缺点是热膨胀系数高，导热性差，软化温度低，容易变形而影响光学性能。</p><p><br/></p><p style=\"line-height: 1.75em;\">太空镜片</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp;PC太空镜片有着极强韧性，不破碎，故又称安全镜片。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; PC的化学名称叫聚碳酸脂(polycarbonate)，是一种环保型工程塑料。PC材料的特点:重量轻、抗冲击强度高、硬度高、折射指数高、机械性能良好、热塑性好、电绝缘性能良好、不污染环境等优点。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; PC的俗称就是防弹玻璃，因此PC镜片秉承了原材料超级抗冲击力的优良特性，并且由于折射率高和比重轻，大大的减轻了镜片的重量，还有更多的优势比如说:100%防紫外线，3-5年之内不会发黄。如果在工艺上没有问题的话，重量比普通树脂片轻37%，抗冲击力更是高达普通树脂的12倍。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; 其特点是安全美观。安全体现在超高的抗破碎性和100%阻挡紫外线，美观体现在镜片薄、透亮，舒适体现在镜片重量轻。值得一提的是各种带偏光或变色的非球面PC近视镜片产品。</p><p><br/></p><p style=\"line-height: 1.75em;\">特殊镜片</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp;渐进多焦点镜片，验光师和眼视光师用其进行视力矫正。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; 这种特殊镜片的设计灵感来源于象鼻子的形状。人们使镜片前表面曲率从顶部到底部连续地增加，可以使其屈光力相应变化，即屈光力从位于镜片上部的远用区，逐渐、连续地增加，直至在镜片底部的近用区达到所需近用屈光度数。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; 一副眼镜既可以看清远处，又可以看清近处，还可以看清中距离物体。所以我们又把渐进镜片形容成&quot;会变焦的镜片&quot;，戴上之后一副眼镜相当于多副眼镜使用。</p><p><br/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; 渐进多焦点镜片在国内呈现极快的发展和普及状态。现今科学家根据不同年龄人群的用眼方式、生理特点，将多焦点镜片最后分为三大类镜片：</p><p><br/></p><p style=\"line-height: 1.75em;\">1.青少年近视控制镜片，减缓视疲劳，控制近视程度。</p><p><br/></p><p style=\"line-height: 1.75em;\">2.成年人抗疲劳镜片--用于教师、医生、近距离和电脑使用过多人群，以减少工作中带来的视觉疲劳。</p><p><br/></p><p style=\"line-height: 1.75em;\">3.中老年渐进片--用于中老年一副眼镜轻松视远视近。</p><p><br/></p>',82,355,1,1,0,0,45,1520521451,0),
	(4,1,'2017温州国际眼镜展隆重开幕 精品展会四大看点','','https://static.ushop.xany6.com/uploads/image/13/134a841878642c562f61b4207cd1f8e0.jpg','<p><video src=\"//mvpc.eastday.com/vgaoxiao/20170521/20170521212947492292352_1_06400360.mp4\"></video>图片<br/></p><div><a class=\"goods-link\" style=\"display: block;background: #f3f3f3;border: 1px solid #eee;position: relative;height: 6rem;color: #333;text-decoration: none\" href=\"/pages/goods/goods?id=37\" goods=\"true\"><img class=\"goods-img\" src=\"https://app.taobaomaichang.com/uploads/image/c5/c547faa9a4976fb48f88d5dfaf52b94b.jpg\" mode=\"aspectFill\"/><div class=\"goods-info flex-col\" style=\"padding:.5rem .5rem .5rem 6rem\"><div class=\"goods-name flex-grow-1\">墨镜款式七</div><div class=\"flex-grow-0\"><strong class=\"goods-price\" style=\"color:#ff4544\">￥799.00</strong><span class=\"buy-btn\" style=\"display: inline-block;float: right;font-size: 12px;border: 1px solid #ff4544;color: #ff4544;border-radius: .15rem;padding: .25rem .5rem;\">去购买</span></div></div></a></div><p><video src=\"//mvpc.eastday.com/vgaoxiao/20170521/20170521212947492292352_1_06400360.mp4\"></video></p>',3,1,0,1,0,0,2,1522306240,1),
