-spacing: normal; line-height: 24px; orphans: 2; text-align: left; text-decoration: none; text-indent: 28px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px; word-wrap: break-word; zoom: 1;\">中国（丹阳）国际眼镜城，与</span><a style=\"background-color: transparent; color: rgb(19, 110, 194); font-family: arial,&amp;quot;宋体&amp;quot;,sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 28px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\" href=\"https://baike.baidu.com/item/%E4%B8%AD%E5%9B%BD%EF%BC%88%E4%B8%B9%E9%98%B3%EF%BC%89%E7%9C%BC%E9%95%9C%E5%9F%8E\" target=\"_blank\">中国（丹阳）眼镜城</a><span style=\"display: inline !important; float: none; background-color: transparent; color: rgb(51, 51, 51); font-family: arial,&quot;宋体&quot;,sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; line-height: 24px; orphans: 2; text-align: left; text-decoration: none; text-indent: 28px; text-transform: none; -webkit-text-stroke-width: 0px; word-spacing: 0px; word-wrap: break-word; zoom: 1;\">相邻，项目位于京杭运河与沪宁城际铁路之间，中山路与站前路交叉口，紧临丹阳火车站与汽车站，该项目总面积为45314平方米，总建筑面积110919平方米，项目总投资约5亿人民币。中国眼镜城大厦总体规划布局由交易区、配套商务酒店组成，交易区面积约6万平方米，以眼镜销售批发为主，南侧的商务酒店面积约2万平方米。既能满足眼镜城的商务办公、旅游接待等配套功能，又是该区域的标志性建筑，展现出了城市的名片形象。丹阳眼镜城项目完全摆脱了传统眼镜市场的单一商业模式，是集休闲娱乐、餐饮住宿、商务办公、影视表演等为一体的体验式商业。该模式表现的是一种城市生活休闲中心，在建筑层面上体现为商业街区模式，这个街区开放通透，内部水街亲切宜人。具有良好的环境和商业氛围。眼镜城的未来不仅仅是单位的商业建筑，也是丹阳市民未来的活动体验中心。</span>',38,1,0,111,0,0,1,1522306529,0),
	(6,1,'上海眼镜展 丹阳当主角','','https://app.taobaomaichang.com/uploads/image/c6/c67a98601b5cb69524797a98b4b5d9a7.jpg','<h3 style=\"padding: 0px; margin: 10px 0px; font-size: 24.5px; font-family: 微软雅黑, \">上海眼镜展 丹阳当主角</h3><div style=\"color: rgb(51, 51, 51); font-family: 微软雅黑, \"><span style=\"font-size: medium;\"><span style=\"font-family: 楷体_GB2312;\">“戴丹阳眼镜，看美丽中国”。为期三天的第十七届中国（上海）国际眼镜业展览会于2月17日在上海世博展览馆隆重闭幕，在来自海内外21个国家和地区的800多家眼镜厂商参展中，丹阳有200多家眼镜厂商参展，占参展厂商的四分之一。</span></span></div><div style=\"color: rgb(51, 51, 51); font-family: 微软雅黑, \"><span style=\"font-size: medium;\"><span style=\"font-family: 楷体_GB2312;\"><img alt=\"\" src=\"http://www.zgdyyjc.com/uploadfile/20170510162544128.jpg\"/></span></span></div><div style=\"color: rgb(51, 51, 51); font-family: 微软雅黑, \"><span style=\"font-size: medium;\"><span style=\"font-family: 楷体_GB2312;\">全球品牌云集，十万客商采购。据了解，本次展览会由中国眼镜协会、中国轻工业对外经济技术合作公司主办，充分展示了当前世界眼镜行业最先进的眼镜产品和技术，是中国官方认可规模最大的国际眼镜工业和贸易展览会之一，也是亚洲区内名牌荟萃的国际眼镜业展览。展会面积7万多平方米，涉及产品贸易、新品发布、学术研讨等活动，与会客商逾10万人次。</span></span></div><div style=\"color: rgb(51, 51, 51); font-family: 微软雅黑, \"><span style=\"font-size: medium;\"><span style=\"font-family: 楷体_GB2312;\">&nbsp;丹凤朝阳，眼镜之都。经过40多年的发展，<span style=\"letter-spacing: 0pt;\">丹阳已成为全国最大的眼镜产业集群，</span>目前，丹阳从事眼镜行业及相关配套的工贸企业有2000多家，从业人员6万余人，<span style=\"letter-spacing: 0pt;\">丹阳镜架年产量约占全国三分之一，镜片年产量约</span>占全国的75%、占全世界的50%。<span style=\"letter-spacing: 0pt;\">已成为“中国眼镜生产基地”“中国眼镜出口基地”。</span></span></span></div><div style=\"color: rgb(51, 51, 51); font-family: 微软雅黑, \"><span style=\"font-size: medium;\"><span style=\"font-family: 楷体_GB2312;\">&nbsp;<span style=\"letter-spacing: 0pt;\">展会上</span><span style=\"letter-spacing: 0pt;\">，中国眼镜协会理事长崔毅对丹阳的眼镜产业现状作了高度评价</span><span style=\"letter-spacing: 0pt;\">，也充分肯定了丹阳眼镜在此次展会上担当的主角作用</span><span style=\"letter-spacing: 0pt;\">，丹阳眼镜品质、品牌都得到了提升，体现在</span><span style=\"letter-spacing: 0pt;\">4号精品馆丹阳企业占了大多数</span><span style=\"letter-spacing: 0pt;\">。</span></span></span></div><div style=\"color: rgb(51, 51, 51); font-family: 微软雅黑, \"><span style=\"font-size: medium;\"><span style=\"font-family: 楷体_GB2312;\">&nbsp;“规模大！规格高！人气旺！”对这次展会，丹阳眼镜商会会长、万新光学集团董事长汤龙保如此感慨，20多个国家、378个国际品牌聚集一起，这是国际国内的一种交流，是一个良好的学习交流平台，他说，“丹阳超万人活跃在这个展会上，毫无疑问，这个展会对丹阳眼镜业的发展将会起到一定的推动和促进作用。”</span></span></div><div style=\"color: rgb(51, 51, 51); font-family: 微软雅黑, \"><span style=\"font-size: medium;\"><span style=\"font-family: 楷体_GB2312;\">&nbsp;&nbsp;展会作用有多大？用天鸿光学董事长洪作南的话说，这是一个巨大的商机和平台，凭他多年的从商经验，他这次热情邀约了600个客户前来光临，“一方面，是搭建企业与客户学习交流的平台；另一方面，在这种国际性的展会上，诚邀客户参展，无形之中增强了企业与客户的感情。”</span></span></div><div style=\"color: rgb(51, 51, 51); font-family: 微软雅黑, \"><span style=\"font-size: medium;\"><span style=\"font-family: 楷体_GB2312;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;丹阳开发区党工委委员、眼镜城市场管理办公室主任韦国忠参观了眼镜城参展企业展台，并与企业负责人亲切交谈，了解参展企业情况。面对200多家眼镜厂商活跃在这个展会，他感慨地说，“上海眼镜展，丹阳眼镜分外妖娆！”</span></span></div><p><br/></p>',13,5000,1,2,0,0,1000,1522308356,0),
