	(8,1,'Percy Lau 个性眼镜大集合','','https://app.taobaomaichang.com/uploads/image/d5/d597b7ccab6d797302ec2a9b683c8e72.jpg','<p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; &nbsp;现如今，在时尚潮流下中规中矩的穿搭已经不再风行，各类充满着个性、潮范儿的服装配饰，带来了更多的关注目光。在配饰造型当中，能够比头饰、颈饰等单品带来更为强大张力的选择，绝对非眼饰莫属，而这都是因为配戴眼饰之时，一次阻挡人身上除了言语以外最具表达能力的关键 ——「眼神」，而在改变轮廓的同时提供了无法解读的神秘印象。</p><p style=\"line-height: 1.75em;\"><img src=\"https://app.taobaomaichang.com/uploads/image/d5/d597b7ccab6d797302ec2a9b683c8e72.jpg\" title=\"\" alt=\"\"/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; 作为现在很多人出行必备的眼镜上，能看到许多大胆前卫的设计款式。而在这些特立独行的眼镜中，偏偏有这么一个品牌，在它目录中的每一款眼镜都是那样的天马行空，充满了个性与前卫。中国香港的配饰设计师Percy Lau的同名品牌，以错位、拼接、几何、借位，各种你意想不到的组合方式都能体现在她的设计上，那些原来看似已经颇有设计感的眼镜也能变身得格外出位。</p><p style=\"line-height: 1.75em;\"><img src=\"https://app.taobaomaichang.com/uploads/image/0f/0f908311f3bedfaf80d4d1d701a26b73.jpg\" title=\"\" alt=\"\"/></p><p style=\"line-height: 1.75em;\">&nbsp; &nbsp; &nbsp; &nbsp;也正是因为这大胆而又前卫的设计风格，一时间成为各路当红明星和时尚达人种草最深的单品。街拍、做节目、哪怕是自拍，Percy Lau眼镜无处不在。</p><p style=\"line-height: 1.75em;\"><img src=\"https://app.taobaomaichang.com/uploads/image/f7/f7b2f9e93e4260b21ba361d6933c1a37.jpg\" title=\"\" alt=\"\"/></p><p style=\"line-height: 1.75em;\"><img src=\"https://app.taobaomaichang.com/uploads/image/a5/a5d97d87a5b2af9a3f500d28d865ab5f.jpg\" title=\"\" alt=\"\"/></p><p style=\"line-height: 1.75em;\"><br/></p><div><a class=\"goods-link\" goods=\"true\" href=\"/pages/goods/goods?id=38\" style=\"display: block;background: #f3f3f3;border: 1px solid #eee;position: relative;height: 6rem;color: #333;text-decoration: none\"><img mode=\"aspectFill\" class=\"goods-img\" src=\"https://app.taobaomaichang.com/uploads/image/df/df9ac637897aeef3f83ee9edb434faf4.jpg\"/><div class=\"goods-info flex-col\" style=\"padding:.5rem .5rem .5rem 6rem\"><div class=\"goods-name flex-grow-1\">全框TR90男女新款成品近视眼镜50-100-150-200-250-300-400-600度</div><div class=\"flex-grow-0\"><strong class=\"goods-price\" style=\"color:#ff4544\">￥48.00</strong><span class=\"buy-btn\" style=\"display: inline-block;float: right;font-size: 12px;border: 1px solid #ff4544;color: #ff4544;border-radius: .15rem;padding: .25rem .5rem;\">去购买</span></div></div></a></div><p style=\"line-height: 1.75em;\"><br/></p><div><a class=\"goods-link\" goods=\"true\" href=\"/pages/goods/goods?id=36\" style=\"display: block;background: #f3f3f3;border: 1px solid #eee;position: relative;height: 6rem;color: #333;text-decoration: none\"><img mode=\"aspectFill\" class=\"goods-img\" src=\"https://app.taobaomaichang.com/uploads/image/c2/c2f1bd9bdc6269154e89427b95a3177f.jpg\"/><div class=\"goods-info flex-col\" style=\"padding:.5rem .5rem .5rem 6rem\"><div class=\"goods-name flex-grow-1\">近视眼镜 女无框眼镜纯钛无螺丝超轻眼睛框架配近视镜切边成品</div><div class=\"flex-grow-0\"><strong class=\"goods-price\" style=\"color:#ff4544\">￥228.00</strong><span class=\"buy-btn\" style=\"display: inline-block;float: right;font-size: 12px;border: 1px solid #ff4544;color: #ff4544;border-radius: .15rem;padding: .25rem .5rem;\">去购买</span></div></div></a></div><p style=\"line-height: 1.75em;\"><br/></p>',8,108,1,1,0,0,67,1522857617,0),
	(9,1,'第七届“伊中眼镜杯”青少年作文选拔大赛火热报名中','','https://app.taobaomaichang.com/uploads/image/86/8629a03b2b43f4683b247b5622ea7708.jpeg','<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 30px; text-indent: 2em; line-height: 26px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal;\">伊犁新闻网讯（记者赵艳）“终于盼来了第七届‘伊中眼镜杯’青少年作文选拔大赛，去年就错过了报名时间，今年一定不能错过了……”伊宁市十七小五年级学生张嘉豪说。由伊犁晚报携手伊犁伊中眼镜商贸有限责任公司独家冠名赞助的第七届“伊中眼镜杯”青少年作文选拔大赛火热报名中，许多学生、家长以及关心此次作文大赛的老师打电话咨询参赛事宜。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 30px; text-indent: 2em; line-height: 26px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal;\">自伊犁晚报刊发大赛启动消息以来，伊犁河谷各校将相关通知转发到班级群，要求学生的参赛作文内容积极向上、主题鲜明，先由本班语文教师选出好作品，再由学校评选出10篇优秀作品。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 30px; text-indent: 2em; line-height: 26px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal;\">伊宁市二十二中四年级学生家长李伟说，看到通知后就琢磨让孩子写篇什么题材的内容，既能写出真情实感，还能传递正能量。他认为，对孩子来说，能否获奖并不重要，重要的是参与过程，以及现场聆听本土作家的点评，对孩子来说是一次难得的好机会。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 30px; text-indent: 2em; line-height: 26px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal;\">据悉，本次大赛分初赛和现场决赛两种形式。即日起，四年级以上、凡具有一定写作水平的学生均可报名参加本届作文选拔大赛初赛。大赛将以学校为参赛单位，先由学校对学生的作文初选，每所学校选出10篇优秀作文，特别好的作品可以适当放宽数量，最后参加现场决赛。作文内容要求积极向上，反映当代学生真实的学习和生活。体裁不限，散文、议论文、记叙文要求在800字以内，诗歌15行以内，需提供电子稿。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 30px; text-indent: 2em; line-height: 26px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal;\">本次大赛分小学组、中学组和高中及以上组，分设一、二、三等奖和优秀奖，获奖者可免费参加本报开展的各项文学采风及社会实践活动。同时，将被吸收成为晚报小记者，并获得由伊中眼镜公司提供的丰厚奖品：一等奖3名，奖品1200元（现金600元、配镜券600元）；二等奖6名，奖品600元（现金300元、配镜券300元）；三等奖9名，奖品400元（现金200元、配镜券200元）；优秀奖30名，奖品为200元配镜券。现场所有参加作文决赛的选手还有小礼品相送。获得一、二、三等奖的作品将刊登在《伊犁晚报·教育周刊》上。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 30px; text-indent: 2em; line-height: 26px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal;\">凡获得一、二、三等奖的选手，其辅导老师也将得到相应奖励：一等奖3名，奖品1000元（现金500元、配镜券500元）；二等奖6名，奖品600元（现金300元、配镜券300元）；三等奖9名，奖品为300元配镜券。初选截稿日期为4月30日。期待大家踊跃参与！</p><p><br/></p>',25,289,1,1,0,0,67,1523676642,0);
